import { HubConnectionBuilder, LogLevel } from '@aspnet/signalr'

class InvoiceHub {
    constructor() {
        this.client =  HubConnectionBuilder
            .withUrl('https://localhost:9091/hub')
            .configureLogging(LogLevel.Information)
            .build()
    }
    start() {
        this.client.start();
    }
}

export default new InvoiceHub();
